import './app.css';
import './components/fonts/font.css';
import Header from './components/Header/header';
import Nav from './components/Nav/nav';
import Producto from './components/Productos/productos';
import Footer from './components/Footer/footer';

function App() {
  return (
      <div className='app'>
        <div className='header'>
          <Header/>
        </div>
        <div className='nav'>
          <Nav/>
        </div>
        <div className="producto" id='producto1'>
          <Producto/>
        </div >
        <div className="producto" id='producto2'>
          <Producto/>
        </div>
        <div className="producto" id='producto3'>
          <Producto/>
        </div> 
        <div className="producto" id='producto4'>
          <Producto/>
        </div>
        <div className="producto" id='producto5'>
          <Producto/>
        </div>
        <div className="producto" id='producto6'>
          <Producto/>
        </div>
        <div className='footer'>
          <Footer/>
        </div>
      </div> 
  );
}

export default App;
